function getFavouritePage(n){$.ajax({type:"GET",url:Urls.GetFavouritePageByUserIdAndPageUrl,data:{pageUrl:n},contentType:"application/json",success:function(n){n.isSuccess?(addFavourite.hide(),deleteFavourite.show(),favouriteId.attr("value",n.data.id)):deleteFavourite.hide()},error:function(n){console.log(n)}})}function addFavorite(n,t){var i={PageName:n,PageUrl:t};$.ajax({type:"POST",url:Urls.AddFavouritePage,data:JSON.stringify(i),contentType:"application/json",success:function(n){n.isSuccess?(showSuccessAlert(n.message),getFavouritePage(t)):showAlert(n.message)},error:function(n){console.log(n)}})}function deleteFavorite(n){$.ajax({type:"POST",url:Urls.DeleteFavouritePage,data:{id:n},dataType:"json",success:function(n){n.isSuccess?(showSuccessAlert(n.message),addFavourite.show(),deleteFavourite.hide()):showAlert(n.message)},error:function(n){console.log(n)}})}const favouritePageName=$("#favouritePageName").val(),favouriteId=$("#favouriteId"),addFavourite=$("#addFavourite"),deleteFavourite=$("#deleteFavourite");$(document).ready(function(){var n=window.location.pathname+window.location.search;getFavouritePage(n)});addFavourite.on("click",()=>{var n=window.location.pathname+window.location.search;addFavorite(favouritePageName,n)});deleteFavourite.on("click",()=>{var n=favouriteId.val();deleteFavorite(n)});